  KEY `idx_uwp_platedfilm_partnum` (`part_num`),
  KEY `idx_uwp_platedfilm_fixtureattribute` (`fixture_attribute`),
  KEY `idx_uwp_platedfilm_operatorid` (`operatorid`)
